import "./App.css";

function App() {
  async function test() {
    fetch("http://localhost:3001/forsinkelser")
      .then((res) => res.json())
      .then((data) => {
        render();
        {
          const { data } = this.state;

          return (
            <div>
              {data.map((item) => (
                <div key={item._id}>
                  <p>ID: {item.id}</p>
                  <p>Line: {item.line}</p>
                  <p>Aimed Time: {item.aimedTime}</p>
                  <p>Expected Time: {item.expectedTime}</p>
                  <p>Name: {item.name}</p>
                </div>
              ))}
            </div>
          );
        }
      });
  }

  return (
    <div className="App">
      <button onClick={test}>TEST</button>
    </div>
  );
}

export default App;
